import Currency from './3-currency';

export default class Pricing {
  constructor(amount, currency) {
    this.amount = amount;
    this.currency = currency;
  }

  set currency(x) {
    console.log(typeof x);
    if (x instanceof Currency) {
      this._currency = x;
    } else {
      throw TypeError('amount must be number');
    }
  }

